
/*Table structure for table `loan_bank_mapping` */

DROP TABLE IF EXISTS `loan_bank_mapping`;

CREATE TABLE `loan_bank_mapping` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(50) COMMENT '银行代码',
  `channel` tinyint(3) COMMENT '通道 1. lakala',
  `channelBankCode` varchar(50) COMMENT '第三方贷款里银行代码',
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

/*Data for the table `loan_bank_mapping` */

LOCK TABLES `loan_bank_mapping` WRITE;


UNLOCK TABLES;

/*Table structure for table `loan_channel` */

DROP TABLE IF EXISTS `loan_channel`;

CREATE TABLE `loan_channel` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `channel` varchar(50) COMMENT '贷款渠道名称',
  `status` tinyint(3) DEFAULT '1' COMMENT '1 有效',
  `rate` tinyint(3) unsigned DEFAULT NULL COMMENT '百分比',
  `ex` tinyint(3) unsigned DEFAULT NULL COMMENT '是否为外部实现',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `loan_channel` */

LOCK TABLES `loan_channel` WRITE;


UNLOCK TABLES;

/*Table structure for table `loan_district_mapping` */

DROP TABLE IF EXISTS `loan_district_mapping`;

CREATE TABLE `loan_district_mapping` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `provienceId` int(10) unsigned,
  `provienceName` varchar(45) DEFAULT NULL,
  `cityId` int(10) unsigned,
  `cityName` varchar(45) DEFAULT NULL,
  `districtId` int(10) unsigned,
  `districtName` varchar(45) DEFAULT NULL,
  `mogoDistrictId` int(10) unsigned DEFAULT NULL,
  `channel` tinyint(3) unsigned DEFAULT '1' COMMENT ' 1: lakala',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2868 DEFAULT CHARSET=utf8;

/*Data for the table `loan_district_mapping` */

LOCK TABLES `loan_district_mapping` WRITE;


UNLOCK TABLES;

/*Table structure for table `loan_support_bank` */

DROP TABLE IF EXISTS `loan_support_bank`;

CREATE TABLE `loan_support_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COMMENT '银行名称',
  `code` varchar(10) COMMENT '银行代码',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

/*Data for the table `loan_support_bank` */

LOCK TABLES `loan_support_bank` WRITE;


UNLOCK TABLES;


